import React, { Component } from 'react'
import {
    BrowserRouter as Router,
    Route,
    Link
  } from "react-router-dom";
import Config from '../tempo'
import Menu from './menu';
import api from '../services/api'

export default class Evaluation extends Component {


    state = {
        show: false,
        loader: false,
        evaluation: [],
        users: [],

        usuario: '',
        foto: null,
        aviso: ''
    }

    handleImageChange = (e) => {
        this.setState({
          foto: e.target.files[0]
        })

      };

    handleChange = e => {
        this.setState({
          [e.target.name]: e.target.value
        })
      }


    async componentDidMount() {
        const { id }  = this.props.match.params;
        const company_id = localStorage.getItem('@Coliseu')

        const evaluation = await api.get(`/auth/evaluation`)
        const users = await api.get(`/auth/user`)

        console.log(evaluation.data)
        console.log(users.data)

        this.setState({
            evaluation: evaluation.data,
            users: users.data
        })

        setTimeout(() =>{
            this.setState({ 
                show: true ,
                loader: false
            })   
        }, Config())
    }

    render(){
        const { users } = this.state;
        console.log(this.state.usuario)
    return (
    <div>
        {this.state.loader === true ? 

            <div className="container fundo">
                <div className="row loader">
                    <div className="col s12 center">
                        <img src="../../logo.svg" width="100px" height="100px" />
                    </div>
                </div>
            </div>
            :

            <div>
                <Menu />
            <div className="orelha"></div>
            <div className="parallax-container targetTopo">
                    <div className="parallax corPadrao">
                        <div className="container">
                            {/* <Link to="/app">
                                <i className="material-icons left medium white-text">chevron_left</i>
                            </Link> */}
                            <h2 style={{ color: '#fff' }}>Avaliação</h2>
                        </div>
                    </div>
            </div>
            <div className="container">
                <div className="row">
                    <form className="col s12">
                        <div className="card-panel" style={{ marginTop: '-40px', borderRadius: '22px' }}>
                        Avaliação
                        </div>
                        <div className="input-field  col s12 center">
                            <div className="col s4">
                                    <div className="btn btn-floating btn-small pulse">
                                        <i className="material-icons right">chevron_right</i>
                                    </div>
                                    &nbsp;&nbsp;
                                    <label>Selecionar Usuario</label>
                            </div>
                            <div className="col s4">
                                <div className="linha">
                                    <label className="linhadentro">_____________________________</label>
                                </div>
                            </div>
                            <div className="col s4">
                                    <div className="btn-flat">
                                        <i className="material-icons right">send</i>
                                    </div>
                                    &nbsp;&nbsp;
                                    <label>Enviar Fotos</label>
                            </div>
                        </div>
                        <div className="input-field  col s6">
                            <select  className="browser-default inputUser validate"  name="usuario"
                                onChange={this.handleChange}>
                                    <option onChange={this.handleChange} selected value="001">Selecione Usuario</option>
                                {  
                                    users.map((el) => (    
                                        <option key={el.id} value={el.id} onChange={this.handleChange}>{el.name}</option>
                                    ))
                                }
                            </select> 
                        </div>

                        <div className="col s12 fotos">
                            <p>Medidas</p>
                            <div className="col s2">
                                <input className="input-field" value="teste" />
                            </div>

                            <div className="col s2">
                                <input className="input-field" value="teste" />
                            </div>

                            <div className="col s2">
                                <input className="input-field" value="teste" />
                            </div>
                        </div>

                    </form>
                </div>
            </div>
        </div>
    }
    </div>
    )
}}
